def Skew(Genome):
	res = [0]
	for nuc in Genome:
		to_app = res[-1]
		if nuc == 'C':
			to_app -= 1
		elif nuc == 'G':
			to_app += 1
		res.append(to_app)
	return res

def MinimumSkew(Genome):
	min_val = 0
	current_val = 0
	min_pos = [0]
	for i, nuc in enumerate(Genome):
		if nuc == 'C':
			current_val -= 1
		elif nuc == 'G':
			current_val += 1
		if current_val < min_val:
			min_pos = [i + 1]
			min_val = current_val
		elif current_val == min_val:
			min_pos.append(i + 1)
	return min_pos
	
Genome = ''
result = MinimumSkew(Genome)
' '.join(map(str, result))


